import React from "react";

const Navbar = () => {
  return (
    <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="/">GrubHub</Navbar.Brand>
      <Navbar.Collapse>
        <Nav className="ml-auto">
          <Nav.Link href="/SignIn">SignIn</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default Navbar;
